import React, { useState } from 'react';
import { apiCall } from '../utils/apiCall';

function Operator() {
    const [queue, setQueue] = useState({});

    function getQueue() {
        apiCall('/queue/progress', 'get').then(res => {
            console.log(res.data);
            setQueue(res.data)
        })
    }

    return (
        <div className='container'>
            <div className="row">
                <div className="card col-4">
                    {
                        queue.id ? <><div className="card-header">
                        <h5>Queue Number: {queue?.queueNumber}</h5>
                    </div>
                    <div className="card-body">
                        <div>Owner: {queue?.name}</div>
                        <div>Queue status: {queue?.queueStatus}</div>
                        <div>Operator: {queue?.operator?.fullName}</div>
                    </div></> : <div className='card-header'><h5 className='text-center'>{queue}</h5></div>
                    }
                    <div className="card-footer">
                        <button onClick={getQueue} className='btn btn-success w-100'>Next</button>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Operator;
